<Russian>:
Вы хотите 'продвинутое' управление или 'простое'?
В любом виде управления мышь управляет самолётом, колёсико мышки - газом.
'Продвинутое': WASD+QE (и стрелочки) управляют направлением самолёта, газ управляется LShift + LCtrl; 
'Простое': WS и стрелочки вверх\вниз отвечают за управление газом; AD+QE - крен и курс;

<Ukrainian>:
Ви хочете 'більш детальне' управління чи 'просте'?
В обоъ видах управління миша керує літаком, колесо миші - газом.
'Більш детальне': WASD+QE (і стрілочки) керують напрямком літака, LShift + LCtrl керують газом; 
'Просте': WS і стрілочки вгору\вниз відповідають за управління газом; AD+QE - крен і курс;

<Belarusian>:
Якое кіраванне — «простае» ці «пашыранае» — вы хочаце выкарыстоўваць?
У абодвух выпадках самалёт кіруецца з дапамогай мышы, а газ — кольцам мышы.
«Простае»: клавішы WS і стрэлкі «Уверх»/«Уніз» адказваюць за кіраванне газам, а клавішы AD+QE — за крэн і курс лёту;
«Пашыранае»: WASD+QE (і стрэлкі) адказваюць за кірунак лёту, а LShift + LCtrl адказваюць за газ;
